import React from "react";

const FlightSearchResult = ({
  origin,
  destination,
  emissions,
  searchSuccessful,
}) => {
  return (
    <div>
      <p>{origin}</p>
      <p>{destination}</p>
      <p>{emissions} searchSuccessful &&</p>
      {searchSuccessful && <button>Add to My Trips</button>}
    </div>
  );
};

export default FlightSearchResult;
